import * as React from 'react';
import { DataGrid } from '@material-ui/data-grid';

export default class MyTable extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      rows: [],
      columns: [],
    };
  }
  columns = [
    { field: 'id', headerName: 'ID', width: 70 },
    { field: 'number', headerName: 'First name', type: 'number', width: 130 },
  ];

  rows = [
    { id: 0, number: 13 },
    { id: 1, number: 17 },
    { id: 2, number: 19 },
  ];

  render() {
    return (
      <div style={{ height: 400, width: '100%' }}>
        <DataGrid
          rows={this.rows}
          columns={this.columns}
          pageSize={5}
          checkboxSelection
        />
      </div>
    );
  }
}
